import React, { useState, useEffect } from "react";
import ImageBox from "../components/ImageBox";
import NavBar from "../components/NavBar";
import { fetchImages } from "../services/model-api";
import { getRandom, loaderMessages, promptIdeas } from "../utilities/utils";
import ChooseResults from "../components/ChooseResults";
import RecentResults from "../components/RecentResults";

const Home = () => {
  // State 변수들 설정
  const [showLoader, setShowLoader] = useState(false);
  const [imageResult, setImageResult] = useState(null);
  const [inputFields, setInputFields] = useState(Array(7).fill(""));
  const [radioValue, setRadioValue] = useState("20");
  const [dropDownValue, setDropDownValue] = useState("DDIM");
  const [seedValue, setSeedValue] = useState(17123564234);
  const [loaderMessage, setLoaderMessage] = useState(loaderMessages[0]);

  // Loader 메시지를 주기적으로 변경하는 useEffect
  useEffect(() => {
    const loaderInterval = setInterval(() => {
      setLoaderMessage(getRandom(loaderMessages));
    }, 3000);
    // 클린업 함수를 사용하여 메모리 누수 방지
    return () => {
      clearInterval(loaderInterval);
    };
  }, [loaderMessage]);

  // 입력 필드 변경 핸들러
  const handleInputChange = (index, event) => {
    const newInputFields = [...inputFields];
    newInputFields[index] = event.target.value;
    setInputFields(newInputFields);
  };

  // 라디오 버튼 및 드롭다운 선택 핸들러
  const handleChange = (event) => {
    if (event.target.name === "radio") {
      setRadioValue(event.target.value);
    } else if (event.target.name === "dropdown") {
      setDropDownValue(event.target.value);
      // 드롭다운 값에 따라 추가 키워드 설정
      const newInputFields = [...inputFields];
      switch (event.target.value) {
        case "Euler":
          newInputFields[7] = "animation character";
          break;
        case "DDPM":
          newInputFields[7] = "real person";
          break;
        case "LMS":
          newInputFields[7] = "building";
          break;
        case "Heun":
          newInputFields[7] = "nature painting";
          break;
        default:
          newInputFields[7] = "";
          break;
      }
      setInputFields(newInputFields);
    } else {
      setSeedValue(event.target.value);
    }
  };

  // 이미지 생성 버튼 클릭 핸들러
  const handleGenerate = (e) => {
    e.preventDefault();
    fetchData();
  };

  // 이미지 데이터를 가져오는 비동기 함수
  const fetchData = async () => {
    try {
      setShowLoader(true);
      const promptQuery = inputFields.join(" ");

      const imageBlob = await fetchImages(
        promptQuery,
        seedValue,
        dropDownValue,
        radioValue
      );

      const fileReaderInstance = new FileReader();
      // FileReader 인스턴스의 onload 이벤트 핸들러 설정
      fileReaderInstance.onload = () => {
        let base64data = fileReaderInstance.result;
        setImageResult(base64data);
      };
      // 이미지 Blob을 데이터 URL로 변환하여 FileReader로 읽기
      fileReaderInstance.readAsDataURL(imageBlob);
      setShowLoader(false);
    } catch (error) {
      // 오류 처리
      console.error("Error fetching images from API:", error);
      setShowLoader(false);
    }
  };

  // '키워드 추천' 버튼 클릭 핸들러
  const handleSurpriseMe = (e) => {
    const surprisePrompt = getRandom(promptIdeas);
    setInputFields([surprisePrompt, "", "", "", "", "", ""]);
  };

  // 선택 가능한 옵션 핸들러
  const handleAvailOptions = (option) => {
    setInputFields([option, "", "", "", "", "", ""]);
  };

  // 새로운 입력 필드 배열 생성
  const newInputFields = [...inputFields];
  newInputFields[0] = inputFields[0] + ' 이름';
  newInputFields[1] = inputFields[1] + ' 나이';
  newInputFields[2] = inputFields[2] + ' 얼굴형';
  newInputFields[3] = inputFields[3] + ' 머리색';
  newInputFields[4] = inputFields[4] + ' 옷';
  newInputFields[5] = inputFields[5] + ' 배경';
  newInputFields[6] = inputFields[6] + ' ';

  // JSX 반환
  return (
    <div>
      <NavBar />
      <div className="surpriseBox">
        <label>캐릭터 생성</label>
      </div>
      <div className="formBox">
        <div className="formValue">
          <label>화풍 선택 &nbsp;</label>
          <select name="dropdown" value={dropDownValue} onChange={handleChange}>
            <option value="Euler">애니</option>
            <option value="DDPM">사람</option>
            <option value="LMS">건축물</option>
            <option value="Heun">풍경화</option>
          </select>
        </div>
        
        <div className="formValue">
          퀄리티 선택 
          <label>
            <input
              type="radio"
              name="radio"
              value="20"
              checked={radioValue === "20"}
              onChange={handleChange}
            />
            저
          </label>
          <label>
            <input
              type="radio"
              name="radio"
              value="30"
              checked={radioValue === "30"}
              onChange={handleChange}
            />
            중 
          </label>
          <label>
            <input
              type="radio"
              name="radio"
              value="50"
              checked={radioValue === "50"}
              onChange={handleChange}
            />
            고
          </label>
        </div>
        <div className="formValue">
          <label>&nbsp;</label>
          <input
            type="number"
            name="input"
            value={seedValue}
            onChange={handleChange}
          />
        </div>
      </div>
      <div>
        <div className="customize">
          <input
            type="text"
            value={inputFields[0]}
            onChange={(e) => handleInputChange(0, e)}
            placeholder={`이름`}
            className="promptInput"
          />
          <input
            type="text"
            value={inputFields[1]}
            onChange={(e) => handleInputChange(1, e)}
            placeholder={`국가`}
            className="promptInput"
          />
          <input
            type="text"
            value={inputFields[2]}
            onChange={(e) => handleInputChange(2, e)}
            placeholder={`얼굴형`}
            className="promptInput"
          />
          <input
            type="text"
            value={inputFields[3]}
            onChange={(e) => handleInputChange(3, e)}
            placeholder={`머리색`}
            className="promptInput"
          />
          <input
            type="text"
            value={inputFields[4]}
            onChange={(e) => handleInputChange(4, e)}
            placeholder={`옷`}
            className="promptInput"
          />
          <input
            type="text"
            value={inputFields[5]}
            onChange={(e) => handleInputChange(5, e)}
            placeholder={`배경`}
            className="promptInput"
          />
          <input
            type="text"
            value={inputFields[6]}
            onChange={(e) => handleInputChange(6, e)}
            placeholder={`이 외 특징`}
            className="promptInput"
          />
        </div>
        {/* <button onClick={handleSurpriseMe}>키워드 추천</button> */}
      </div>
      <div>
        <button onClick={handleGenerate}>그림 그리기</button>
      </div>

      {/* 로딩 중인 경우 보여줄 메시지 */}
      {showLoader ? (
        <div style={{ margin: 40 }}>기다려주세요... ⚡️⚡️⚡️</div>
      ) : (
        // 이미지 박스 컴포넌트
        <>
          <ImageBox promptQuery={inputFields.join(" ")} imageResult={imageResult} />
        </>
      )}
      {/* 선택 가능한 옵션들 컴포넌트 */}
      <ChooseResults onSelect={handleAvailOptions} /> 

      {/* 최근 결과들 컴포넌트 */}
      <RecentResults
        promptQuery={newInputFields.join(" ")}
        imageResult={imageResult}
        onSelect={handleAvailOptions}
      />

      {/* 슬라이드쇼 메시지 */}
      <div className="slideShowMessage">{loaderMessage}</div>
      {/* Footer */}
